import { Box, Typography } from '@mui/material'
import Layout from '../Components/Layout/Layout'
import chicken from '../images/imgcontact.jpg'

function Contact() {
  return (
    <Layout>
      <Box>
        <div className='contact-div' style={{
          backgroundImage: `url(${chicken})`, minHeight: '500px',
          textAlign: 'center', backgroundSize: 'cover',
          backgroundRepeat: 'no-repeat'
        }}>

          <div style={{marginTop:'200px'}}>
          <h1 variant='h4'
            component={'h1'}
            sx={{
              color: 'black',
              textAlign: 'center', margin: '0 400px',
              textShadow: '2px 2px rgb(243, 4, 4)'
            }}>We would love to hear from you!
          </h1>
          </div>

        </div >
      </Box>
    </Layout>
  )
}

export default Contact
